svg.script:
(function(){
  var svg = document.currentScript && document.currentScript.ownerSVGElement; if(!svg){return}
  var ns = svg.namespaceURI;
  var areasGroup = svg.querySelector('#interactive-areas'); if(!areasGroup){areasGroup=document.createElementNS(ns,'g');areasGroup.setAttribute('id','interactive-areas');svg.appendChild(areasGroup)}
  var labelsGroup = svg.querySelector('#interactive-labels'); if(!labelsGroup){labelsGroup=document.createElementNS(ns,'g');labelsGroup.setAttribute('id','interactive-labels');svg.appendChild(labelsGroup)}
  var storageKey='changan_area_names';
  var namesMap={}; try{namesMap=JSON.parse(localStorage.getItem(storageKey)||'{}')||{}}catch(e){namesMap={}}
  function save(){try{localStorage.setItem(storageKey,JSON.stringify(namesMap))}catch(e){}}
  function createLabel(id,bbox){var t=document.createElementNS(ns,'text');t.setAttribute('class','area-label');t.setAttribute('x',(bbox.x+bbox.width/2).toFixed(1));t.setAttribute('y',(bbox.y+bbox.height/2).toFixed(1));t.textContent=namesMap[id]||('區域 '+id);labelsGroup.appendChild(t);return t}
  function updateLabelPosition(t,bbox){t.setAttribute('x',(bbox.x+bbox.width/2).toFixed(1));t.setAttribute('y',(bbox.y+bbox.height/2).toFixed(1))}
  var paths=Array.prototype.slice.call(svg.querySelectorAll('path'));
  var primaryFills={'#1B1B1B':1,'#1D1D1D':1};
  var extraFills={'#1F1F1F':1};
  function isValidBox(b){return b && isFinite(b.x) && isFinite(b.y) && isFinite(b.width) && isFinite(b.height) && b.width>0 && b.height>0}
  function isHuge(b){return b.width>1400 && b.height>1400}
  function minDim(b){return Math.min(b.width,b.height)}
  function area(b){return b.width*b.height}
  function overlaps(b1,b2){var x1=Math.max(b1.x,b2.x), y1=Math.max(b1.y,b2.y), x2=Math.min(b1.x+b1.width,b2.x+b2.width), y2=Math.min(b1.y+b1.height,b2.y+b2.height); return (x2>x1 && y2>y1)}
  var primary=[]; var extra=[];
  for(var i=0;i<paths.length;i++){
    var p=paths[i]; var f=(p.getAttribute('fill')||'').toUpperCase(); var b; try{b=p.getBBox()}catch(e){continue}
    if(!isValidBox(b) || isHuge(b)) continue;
    if(primaryFills[f] && minDim(b)>=40){ primary.push({path:p,bbox:b}); continue }
    if((primaryFills[f]||extraFills[f]) && minDim(b)>=8 && area(b)>=300){ extra.push({path:p,bbox:b}); }
  }
  var candidates=primary.slice();
  for(var k=0;k<extra.length;k++){
    var eb=extra[k].bbox; var ok=true; for(var m=0;m<primary.length;m++){ if(overlaps(eb,primary[m].bbox)){ ok=false; break } }
    if(ok){ candidates.push(extra[k]) }
  }
  // 追加：根據已知區塊之間的空隙，自動生成「間隙矩形」作為可點擊區域（處理白線框出的空白矩形）
  function vOverlap(b1,b2){var y1=Math.max(b1.y,b2.y), y2=Math.min(b1.y+b1.height,b2.y+b2.height); return Math.max(0,y2-y1)}
  function hOverlap(b1,b2){var x1=Math.max(b1.x,b2.x), x2=Math.min(b1.x+b1.width,b2.x+b2.width); return Math.max(0,x2-x1)}
  var allBoxes=candidates.map(function(c){return c.bbox});
  var gapRects=[];
  for(var a=0;a<allBoxes.length;a++){
    for(var b=a+1;b<allBoxes.length;b++){
      var A=allBoxes[a], B=allBoxes[b];
      // 水平間隙（A 在左、B 在右）
      var Ax2=A.x+A.width, Bx2=B.x+B.width;
      if(Ax2<=B.x || Bx2<=A.x){
        var left=A, right=B; if(B.x < A.x){ left=B; right=A }
        var vo=vOverlap(left,right);
        var gw=right.x-(left.x+left.width);
        if(gw>6 && vo>20){
          var gy=Math.max(left.y,right.y), gh=Math.min(left.y+left.height,right.y+right.height)-gy;
          if(gh>20){ gapRects.push({x:left.x+left.width, y:gy, width:gw, height:gh}); }
        }
      }
      // 垂直間隙（A 在上、B 在下）
      var Ay2=A.y+A.height, By2=B.y+B.height;
      if(Ay2<=B.y || By2<=A.y){
        var top=A, bottom=B; if(B.y < A.y){ top=B; bottom=A }
        var ho=hOverlap(top,bottom);
        var gh2=bottom.y-(top.y+top.height);
        if(gh2>6 && ho>20){
          var gx=Math.max(top.x,bottom.x), gw2=Math.min(top.x+top.width,bottom.x+bottom.width)-gx;
          if(gw2>20){ gapRects.push({x:gx, y:top.y+top.height, width:gw2, height:gh2}); }
        }
      }
    }
  }
  // 過濾與現有候選重疊明顯者，並加入
  function overlapsAny(r, list){ for(var i=0;i<list.length;i++){ if(overlaps(r, list[i].bbox)) return true } return false }
  for(var g=0;g<gapRects.length;g++){
    var gb=gapRects[g]; if(!isValidBox(gb)) continue; if(minDim(gb)<20 || area(gb)<600) continue;
    if(!overlapsAny(gb, candidates)){
      candidates.push({path:null, bbox:gb});
    }
  }
  while(areasGroup.firstChild){areasGroup.removeChild(areasGroup.firstChild)}
  while(labelsGroup.firstChild){labelsGroup.removeChild(labelsGroup.firstChild)}
  for(var j=0;j<candidates.length;j++){
    var id=String(j+1); var b=candidates[j].bbox; var r=document.createElementNS(ns,'rect');
    r.setAttribute('x',b.x.toFixed(1)); r.setAttribute('y',b.y.toFixed(1)); r.setAttribute('width',b.width.toFixed(1)); r.setAttribute('height',b.height.toFixed(1));
    r.setAttribute('class','area-overlay'); r.setAttribute('data-id',id); r.setAttribute('fill','rgba(255,255,255,0)'); r.setAttribute('stroke','none');
    r.addEventListener('click',function(ev){var rr=ev.currentTarget;rr.classList.toggle('area-selected')});
    r.addEventListener('dblclick',function(ev){var rr=ev.currentTarget;var aid=rr.getAttribute('data-id');var cur=namesMap[aid]||('區域 '+aid);var next=prompt('請輸入區域名稱：',cur);if(next&&next.trim()){namesMap[aid]=next.trim();save();var lab=labelsGroup.querySelector('text[data-id="'+aid+'"]');if(lab){lab.textContent=namesMap[aid]}}});
    areasGroup.appendChild(r);
    var label=createLabel(id,b); label.setAttribute('data-id',id); updateLabelPosition(label,b);
  }
})()
